// src/pages/PaymentPage.jsx
import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { rentBook } from "../services/rentalService";
import "../styles/Payment.css";

const PaymentPage = () => {
  const { state } = useLocation();
  const navigate = useNavigate();

  const { book, days } = state || {};

  const [loading, setLoading] = useState(false);
  const [rentalSuccess, setRentalSuccess] = useState(false);
  const [rentalDetails, setRentalDetails] = useState(null);

  if (!book || !days) {
    return (
      <div className="payment-container">
        <h2>No payment data found</h2>
        <button onClick={() => navigate("/books")} className="pay-btn">
          Go Back to Books
        </button>
      </div>
    );
  }

  const pricePerDay = 5;
  const totalAmount = days * pricePerDay;

  const confirmPayment = async () => {
    setLoading(true);
    try {
      const rental = await rentBook(book.id, days);
      setRentalDetails({
        ...book,
        days,
        totalAmount,
        rentedOn: new Date().toLocaleDateString(),
      });
      setRentalSuccess(true);
    } catch (err) {
      alert(err.response?.data?.error || "Rental failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="payment-container">
      {!rentalSuccess ? (
        <>
          <h1>Payment</h1>
          <div className="payment-card">
            <img
              src={book.image_url || "https://via.placeholder.com/150x220"}
              alt={book.title}
            />
            <div className="payment-info">
              <h2>{book.title}</h2>
              <p><strong>Author:</strong> {book.author}</p>
              <p><strong>Duration:</strong> {days} days</p>
              <p><strong>Price per day:</strong> ₹{pricePerDay}</p>
              <p><strong>Total Amount:</strong> ₹{totalAmount}</p>
            </div>
          </div>
          <button
            onClick={confirmPayment}
            disabled={loading}
            className="pay-btn"
          >
            {loading ? "Processing..." : "Confirm Payment"}
          </button>
        </>
      ) : (
        <div className="success-card">
          <h1>Payment Successful ✅</h1>
          <div className="payment-card">
            <img
              src={rentalDetails.image_url || "https://via.placeholder.com/150x220"}
              alt={rentalDetails.title}
            />
            <div className="payment-info">
              <h2>{rentalDetails.title}</h2>
              <p><strong>Author:</strong> {rentalDetails.author}</p>
              <p><strong>Duration:</strong> {rentalDetails.days} days</p>
              <p><strong>Total Paid:</strong> ₹{rentalDetails.totalAmount}</p>
              <p><strong>Rented On:</strong> {rentalDetails.rentedOn}</p>
            </div>
          </div>
          <button onClick={() => navigate("/my-rentals")} className="pay-btn">
            Go to My Rentals
          </button>
        </div>
      )}
    </div>
  );
};

export default PaymentPage;
